import React from 'react'
import addButtonImg from '../images/add.png'


class AddButton extends React.Component{
    render(){
        return(
            <div className="row">
                <div className="col-md-12 center">
                    <img className="" src={addButtonImg}></img>
                </div>
            </div>
        )
    }
}

export default AddButton
